import React from 'react';
import './App.css';
import Loginpage from "./loginpage";
import Homepage from "./homepage";

type State = {
    ableToLogin: boolean
};

const initialState: State = {
    ableToLogin: false
};

function App(this: any) {

    if (this.ableToLogin) {
        return (
            <Homepage/>
        );
    } else {
        this.ableToLogin = true
        return (
            <Loginpage/>
            );
    }

}

export default App;
